import { useEffect } from "react"

const Users = () => {

    const getUsersData = () => {
        const res = axios.get("https://jsonplaceholder.typicode.com/users")
    }

    useEffect(() => {
      getUsersData();
    }, [])
    return (
        <div className="users-page">
            <h1>Users</h1>

        </div>
    )
}
export default Users
